reviewContent:
깔끔하고 안정적이게 포장이 잘 되어서 왔어요!
근데 큐빅이 몇개가 무언가 묻어있거나 흠집이 나있긴한데, 그래도 만족해요!
이뻐요&hearts;&hearts;

배송 엄청 빨랐어요..
집에만 있는 반백수 초등생을 위해 두 개 구입했는데 어쩌다 보니 하나는 제가 했네요.. 시간 잘 가네요^^;;
완성하고 나니 뭔지 모를 뿌듯함도 있고 좋네요.

아이들 심심해할때 좋아요~
완성후 뿌듯해하고 이쁩니다
많이 파세용~&hearts;

